import React from 'react'
import event from './images/events.jpeg'

const Event1 = () => {
    const headerStyle = {
        backgroundImage: `url(${event})`,
        backgroundSize: '1297px',
        backgroundAttachment: 'fixed',
        height: '60vh',
        width: '100%',
        position: 'relative',
    };

    
     
    const containerStyle = {
        display: 'flex',
        color: 'white',
        flexDirection: 'column',
        alignItems: 'center',
        paddingTop: '50px',
      };
    
      const headingStyle = {
        fontSize: '40px',
        textAlign: 'center',
        marginBottom: '20px',
      };
    
      const bulletPointsStyle = {
        listStyleType: 'disc',
        textAlign: 'center',
      };



    return (
        <>
    <header style={headerStyle}>
      <h1 style={headingStyle}></h1>
    </header>

<div className="container">
<h1 className="heading">Events</h1>
<ul className="bullet-points">
  <li>Event 1</li>
  <li>Event 2</li>
  <li>Event 3</li>
  <li>Event 4</li>
</ul>
</div>
</>
    )
}

export default Event1
